import { ReactReduxContext } from "react-redux";
import {createStore} from 'redux'
import score from './reducers/score'

export default createStore(
    score,
    window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__()
    );
